import React from 'react';
import {Link} from 'react-router-dom';

export const Header = () => {
  return (
    <header className='header'>
        <div className='width'>
            <a href="">
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 48 48" width="24">
                    <path d="M400-80 0-480l400-400 71 71-329 329 329 329-71 71Z"/>
                </svg>
            </a>
            <h1>
                <Link to="/">Coiner!</Link>
            </h1>
        </div>

    </header>
  )
}
